import React, {Component} from 'react';

import Heading from './Heading';

class Users extends Component {

    constructor() {
        this.state = {
            users: ['Adam', 'Olga', 'Kasia']
        }
    }

    render () {
        return (
            <div className="users">
                <Heading text="User's list"/>
            </div>
        );
    };
}

export default Users;
